import { Link, Outlet } from 'react-router-dom';
import classes from './Navigation.module.css';

const Navigation = () => {
    const menuItems = [
        {
            "id": 1,
            "name": "Home",
            "path": "/",
            "aligment": "left"
        },
        {
            "name": "Tasks",
            "path": "/taks",
            "aligment": "left"
        },
        {
            "name": "Test",
            "path": "/test",
            "aligment": "left"
        },
        {
            "name": "Results",
            "path": "/result",
            "aligment": "right"
        }
    ];

    const MenuList = menuItems.map((menu) => {
        return <li className={classes.navList}>
            <Link className={menu.aligment === "left" ? `${classes.navLink}` :`${classes.navLink} ${classes.active}`} to={menu.path}>{menu.name}</Link>
        </li>
    });

    return(
        <>
        <nav>
            <ul className={classes.navListWrapper}>
                <li className={`${classes.navList} ced-logo`}>
                    <img src="/assets/white-logo.png" width="70px" height="55px" alt="logo" />
                </li>
                <li className={classes.navList}>
                    <Link className={classes.navLink} to="/">Home</Link>
                </li>
                <li className={classes.navList}>
                    <Link className={classes.navLink} to="/tasks">Tasks</Link>
                </li>
                <li className={classes.navList}>
                    <Link className={classes.navLink} to="/test">Test</Link>
                </li>
                <li className={`${classes.navList} ${classes.rightMenu}`}>
                    <Link className={`${classes.navLink} ${classes.active}`} to="/result">Result</Link>
                </li>
            </ul>
        </nav>
        <Outlet/>
        </>
    );
}  
export default Navigation;
